import {Link} from 'react-router-dom'
// import jpIMG from './imagem'

import { LayoutComponents, Tooltip } from '../../components/LayoutComponents';
import { ApiLogin } from '../../services/api';

export const Login = () => {
	const [email, setEmail] = useState("")
	const [password, setPassword] = useState("")
	const [responsee, setResponsee] = useState("")

	useEffect(
		() => {
			setResponsee(SendLogin(email, password))
		}, [responsee, email, password]
	)

	async function SendLogin(email, password) {
		var response = (await ApiLogin(email, password))
		if (response.error) {
	}
}

	return (
		<LayoutComponents>
			<form className="login-form">
				<span className="login-form-title">Bem Vindo!</span>

					<div className="wrap-input">
						<input className={email !== "" ? 'has-val input' : 'input' }
							type="text"
							value={email}
							onChange={e => setEmail(e.target.value)}
						/>
						<span className="focus-input" data-placeholder="Email"></span>
				</div>

				<div className="wrap-input">
					<input className={password !== "" ? 'has-val input' : 'input'}
						type="password"
						value={password}
						onChange={e => setPassword(e.target.value)}
					/>
					<span className="focus-input" data-placeholder="Password"></span>
					<Tooltip text="senha inválida" icon="bi bi-exclamation-triangle-fill"></Tooltip>
				</div>

				<div className="container-login-form-btn">
					<button type="button" className="login-form-btn" onClick={
						() => SendLogin(email, password)}>Login</button>

				</div>

				<div className="text-center">
					<span className="txt1">Não possui conta?</span>
					<Link className="txt2" to="/register">Criar conta.</Link>
				</div>
			</form>
		</LayoutComponents>
	)
}
